// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "../NFT/IFFNFT.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Lootbox is Pausable, Ownable {

    address signer;
    uint256 nftCounter;
    mapping(uint256 => IFFNFT) nfts;
    mapping(IFFNFT => uint256[]) propertyIds;
    /// @dev Rarity in percent 0 - 100
    mapping(IFFNFT => uint256[]) public propertyRarity;
    /// @notice Prevents using one signature few times
    mapping(address => uint256) public currentUserLoot;

    event Loot(address indexed looter, IFFNFT indexed nft, uint256 indexed propertyId);

    /// @param _propertyIds NFTs => propertyIds
    /// @param _propertyRarity NFTs => propertyRarity
    constructor(IFFNFT[] memory _nfts, uint256[][] memory _propertyIds, uint256[][] memory _propertyRarity, address _signer) {
        require(_nfts.length != 0, "FairFight Lootbox: NFTs empty");
        require(_nfts.length == _propertyIds.length && _propertyIds.length == _propertyRarity.length, "FairFight Lootbox: Wrong array length");
        for (uint256 i = 0; i < _nfts.length; i++) {
            require(_propertyIds[i].length != 0, "FairFight Lootbox: Property Ids is empty");
            nfts[nftCounter] = _nfts[i];
            propertyIds[_nfts[i]] = _propertyIds[i];
            propertyRarity[_nfts[i]] = _propertyRarity[i];
            nftCounter++;
        }
        signer = _signer;
    }

    /// @notice Allowes to loot some reward for user
    /// @dev Only if user is verified
    /// @param r - Part of signature.
    /// @param v - Part of signature.
    /// @param s - Part of signature.
    /// @param somenumber - Some random number
    function loot(bytes32 r, uint8 v, bytes32 s, uint256 somenumber) external view returns(uint256, uint256, uint256) {
        require(_check(r, v, s, somenumber), "FairFight Lootbox: Not verified");
        uint256 randomNftCounter = getPseudoRandomNumber(somenumber, msg.sender, nftCounter);
        IFFNFT randomNft = nfts[randomNftCounter];
        uint256 randomPropertyIdIndex = getPseudoRandomNumber(somenumber, address(randomNft), propertyIds[randomNft].length);
        uint256 randomRarity = getPseudoRandomNumber(somenumber, address(randomNft), 100);
        return (randomNftCounter, randomPropertyIdIndex, randomRarity);
        // uint256 randomNftPropertyId = propertyIds[randomNft][randomPropertyIdIndex];
        // randomNft.mint(msg.sender, randomNftPropertyId);
        // currentUserLoot[msg.sender] += 1;
        // emit Loot(msg.sender, randomNft, randomNftPropertyId);
    }

    function getPseudoRandomNumber(uint256 _somenumber, address _someaddress, uint256 _max) private view returns (uint8) {
        uint256 pseudoRandomNumber = uint256(keccak256(abi.encodePacked(_someaddress, block.number, block.prevrandao, _somenumber, blockhash(block.number - 1))));
        return uint8(pseudoRandomNumber % _max); 
    }

    function _check(bytes32 _r, uint8 _v, bytes32 _s, uint256 _somenumber) private view returns (bool) {
        bytes32 hash = keccak256(
            abi.encodePacked(
                _somenumber,
                msg.sender,
                address(this),
                currentUserLoot[msg.sender]
            )
        );
        return
            signer ==
            ecrecover(
                keccak256(
                    abi.encodePacked("\x19Ethereum Signed Message:\n32", hash)
                ),
                _v,
                _r,
                _s
            );
    }

    function setPropertyIds(IFFNFT _nft, uint256[] memory _propertyIds) external onlyOwner {
        require(_propertyIds.length != 0, "FairFight Lootbox: Property Ids is empty");
        propertyIds[_nft] = _propertyIds;
    }

    function setSigner(
        address _signer
    ) external onlyOwner {
        require(_signer != address(0), "FairFight Lootbox: Signer cant be address zero");
        signer = _signer;
    }

}

